def nacci(n): # generator of n_nacci terms
    window = [0]*(n-1) + [1]
    yield from window
    while True:
        an = sum(window)
        yield an
        window = window[1:] + [an]
def a(n):
    pow2 = 1
    for k, t in enumerate(nacci(n)):
        if k > n + 1: pow2 <<= 1
        if 0 < t < pow2: return k-1
